import {Route} from 'react-router-dom';
import AllMeetupsPage from './pages/AllMeetups';
import FavoritesPage from './pages/Favorites';
import NewMeetupPage from './pages/NewMeetup';

function App() {
  return (
  <div>
    <switch>
    <Route path = {'/'}>
      <AllMeetupsPage />
    </Route>

    <Route path = {'/NewMeetup'}>
      <NewMeetupPage />
    </Route>

    <Route path = {'/Favorites'}>
      <FavoritesPage />
    </Route>
    </switch>
  </div>);
}

export default App;
